(()=>{"use strict";document.addEventListener("DOMContentLoaded",(()=>{const e={burger:document.querySelector('[data-id="open-nav"]'),close:document.querySelector('[data-id="close-nav"]'),mobileNav:document.querySelector('[data-id="mobile-nav"]')},t="menu-hidden";e.burger.addEventListener("click",(()=>{e.mobileNav.classList.remove(t)})),e.close.addEventListener("click",(()=>{e.mobileNav.classList.add(t)})),console.log("app initialized...")}))})();